import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p> Fly At Will </p>
        <form>
          <label>Departure <input type="text" name="name" /></label>
          <label>Arrival <input type="text" name="name" /></label>
          <label>Date <input type="text" name="name" /></label>
          <label>Arrival <input type="text" name="name" /></label>
          <form className={classes.container} noValidate>
  <TextField
    id="date"
    label="Birthday"
    type="date"
    defaultValue="2017-05-24"
    className={classes.textField}
    InputLabelProps={{
      shrink: true,
    }}
  />
</form>
          <input type="submit" value="Submit" />
        </form>
      </header>
    </div>
  );
}


export default App;

